import { Component } from "react";
import "./item.css"


class Item extends Component {
    render() {
        return (
            <div className="item-container">
                <img className="item-image"
                    srcSet="/react-training/src/image/cart.jpeg"></img>
            </div>
        );
    }
}
export default Item;
